import axios from 'axios'
import React, {useState, useEffect} from 'react'
import { useDispatch, useSelector } from 'react-redux'
export default function UpdateProjectStatus() {

    const user = useSelector((state) => state.userObj.userObj)
    const [allProjects, setAllProjects] = useState(null);
    useEffect(() => {
        const getAllProjects = async () => {
            const projects = await axios.get("http://localhost:5000/user/update")
            if (projects.data && projects.data.status === "success") {
                setAllProjects(projects.data.allProjects)
            }
        }
        getAllProjects()

    }, [])
    console.log("all projects", allProjects);

  return (
    <div>
        <h3>this is update project</h3>
    </div>
  )
}
